func NewBit2c(userConfig map[string]interface{}) *Bit2c {
   p := NewBit2cCore()
   p.Init(userConfig)
   return &Bit2c{
       Bit2cCore: p,
       Core:  p,
       exchangeTyped: NewExchangeTyped(&p.Exchange),
   }
}
func NewBit2cFromCore(core *Bit2cCore) *Bit2c {
   return &Bit2c{
       Bit2cCore: core,
       Core:  core,
       exchangeTyped: NewExchangeTyped(&core.Exchange),
   }
}

